styles:
body{margin:0;padding:0;background-color:#bdd4de;color:#616161;font-size:13px;line-height:1.42857143;font-family:'Open Sans',sans-serif}
a{color:#09f;border:0px;outline:0px}
a:hover{color:#008be8}
div{box-sizing:border-box}
h1{font-size:18px;text-align:center;margin:20px 0;letter-spacing:-.25px}
#container{max-width:500px;width:100%;min-width:300px;margin:20px auto}
#panel-header{text-align:center;padding:14px}
#panel-header img{max-width:450px;border:0px;outline:0px}
#panel-body{background:#fafafa;border-radius:8px;padding:40px;margin-bottom:14px}
#panel-footer{text-align:center;padding:0 45px;margin-bottom:20px}
.divider{text-align:center;position:relative;margin:20px 0 40px}
.divider:before{background-color:#cfd8dc;content:"";display:block;height:1px;left:0;position:absolute;top:50%;width:100%}
.divider span{background:#fafafa;position:relative;padding:0 20px;color:#09f;font-size:24px;font-weight:700}
.btn{outline:0;display:inline-block;padding:6px 12px;font-size:18px;font-weight:700;line-height:1.42857143;text-align:center;vertical-align:middle;-ms-touch-action:manipulation;touch-action:manipulation;cursor:pointer;-webkit-user-select:none;-moz-user-select:none;-ms-user-select:none;user-select:none;background-image:none;border:1px solid transparent;border-radius:4px;width:100%;color:#FFF;background:#bdbdbd;margin-bottom:20px;letter-spacing:-.25px}
.btn:hover{background:#24cc82}
.btn:active{background:#20b674}
#managesubscriptions p{margin-bottom:25px;font-size:16px}
#selectbox li{margin-bottom:10px;margin-top:5px}
#selectbox li:last-of-type{margin-bottom:0}
.checkbox{display:inline-block;cursor:pointer;position:relative;line-height:18px;-webkit-user-select:none;-moz-user-select:none;-ms-user-select:none;user-select:none;vertical-align:middle}
.checkbox:before{content:"";display:inline-block;width:16px;height:16px;vertical-align:middle;background:#fafafa;color:#f3f3f3;text-align:center;border-radius:4px;border:1px solid #bdbdbd;margin-right:15px;position:relative;bottom:1px}
.checkbox svg{display:none;position:absolute;left:0;top:2px;z-index:1}
input[type=checkbox]{display:none}
input[type=checkbox]:checked + .checkbox svg{display:block}
input[type=checkbox]:checked + .checkbox:before{background:#24cc82;border-color:#24cc82}
#selectbox{max-height:125px;overflow-x:hidden;overflow-y:auto;margin:0 0 40px;padding:0 0 0 20px;list-style:none}
.block-center{display:block;width:300px;margin:auto}
.website{display:block;margin-bottom:10px;}
.brand{background:#FFF}
#inputbox li{margin-bottom:10px;margin-top:5px}
#inputbox li:last-of-type{margin-bottom:0}
#inputbox{max-height:125px;overflow-x:hidden;overflow-y:auto;margin:0 0 40px;padding:0 0 0 0;list-style:none;text-align:center}
.block-center{display:block;width:300px;margin:auto}
.website{display:block;margin-bottom:10px;}
.brand{background:#FFF}
